package com.course.courseselection.entity;import org.hibernate.annotations.GenericGenerator;import javax.persistence.*;import javax.validation.constraints.Size;import java.util.List;@Entity@Table(name = "Course")public class Course {    @Id    @GeneratedValue(generator = "uuid")    @GenericGenerator(name = "uuid", strategy = "uuid")    @Column(name = "courseId", nullable = false, unique = true)    @Size(max = 36)    private String id;    @Column(name = "course", nullable = false)    private String course;    @ManyToMany(mappedBy = "courses")    private List<StudentData> students;    public String getId() {        return id;    }    public void setId(String id) {        this.id = id;    }    public String getCourse() {        return course;    }    public void setCourse(String course) {        this.course = course;    }    public List<StudentData> getStudents() {        return students;    }    public void setStudents(List<StudentData> students) {        this.students = students;    }}